package PatternQuestions;

public class nestedProbleQ1 {
	
	void bh ()
	{
		for (int i=1; i<=5; i++)
		{
			for (int j=1; j<=5; j++)
			{
				
				int num=0;
				num = i*j;
				
				System.out.print(" ");
				
				System.out.print(num);
			}
			System.out.println(" ");
		}}
			
		
		public static void main(String[] args) {
		// TODO Auto-generated method stub
		nestedProbleQ1 obj = new nestedProbleQ1 ();
		obj.bh();
	}

}
